n    When I click on Shop By Category burger button\r\n    And I click on Computers\r\n    And I click on Computers \u0026 Tablets\r\n    Then I verify Computers \u0026 Tablets page with ASUS on \u0027Featured Brand\u0027 selection\r\n\r\n  @HomeTest @SmokeTest\r\n  Scenario: Check that user can navigate to \u0027Computers \u0026 Tablets\u0027 page and select \u0027HP\u0027 from \u0027Featured Brands\u0027 selection.\r\n    When I click on Shop By Category burger button\r\n    And I click on Computers\r\n    And I click on Computers \u0026 Tablets\r\n    And I click on HP checkbox from Featured Brands selection\r\n    Then I verify that HP checkbox is selected.","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Shakir/Desktop/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Home.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Amazon homepage functionality check","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on Amazon homepage","id":"5b0f5249-5713-41ce-883e-54e9651beaff"}],"id":"c5f3f5a6-2092-4100-8e75-d8e849e3b678"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@HomeTest","id":"5e4dbd81-4e67-45f9-9cff-9bb21034ea45"},{"location":{"line":6,"column":13},"name":"@SmokeTest","id":"ca9cd916-fb27-4a2d-99d0-da4772236c09"}],"keyword":"Scenario","name":"Check that Amazon homepage loads using title","steps":[{"location":{"line":8,"column":5},"keyword":"Then ","text":"I verify Amazon homepage with title","id":"8ef3367f-f59b-4b6c-b227-3fbbbc074d44"}],"id":"d697edd9-2e18-440b-bef9-72e826a42529"}},{"scenario":{"location":{"line":11,"column":3},"tags":[{"location":{"line":10,"column":3},"name":"@HomeTest","id":"877eb311-1203-4e86-986d-4b58ba6fc3d8"},{"location":{"line":10,"column":13},"name":"@SmokeTest","id":"880cf8f0-94 stNodeId":"73f6b283-a731-4919-8c79-31837e78f54e"}],"astNodeIds":["5c128d01-77c2-400f-9ebc-b590926366aa"]}},{"pickle":{"id":"aefbc2ac-628c-458a-9d45-c99b24926e42","uri":"file:///C:/Users/Shakir/Desktop/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Home.feature","name":"Check that user can navigate to \u0027Computers \u0026 Tablets\u0027 page and select \u0027HP\u0027 from \u0027Featured Brands\u0027 selection.","language":"en","steps":[{"text":"I am on Amazon homepage","id":"ffb0fb04-bcc0-426e-baed-b1531a0e385b","astNodeIds":["5b0f5249-5713-41ce-883e-54e9651beaff"]},{"text":"I click on Shop By Category burger button","id":"4e87961f-ebee-49aa-a65c-7ad0b3a41233","astNodeIds":["069bd154-9029-4cc2-bc94-2edabfd699bc"]},{"text":"I click on Computers","id":"94add1bb-0059-483d-b865-40b9b6891cca","astNodeIds":["953bf384-8962-40ec-b522-e6e73ea7f566"]},{"text":"I click on Computers \u0026 Tablets","id":"d8e8ab1d-65c6-4334-a8e4-e875d49030c9","astNodeIds":["e65dea3d-a1c7-4ea5-837a-25b4fad5b2f1"]},{"text":"I click on HP checkbox from Featured Brands selection","id":"800b3c15-3cdb-4731-8410-62f79ec11d9d","astNodeIds":["9177675d-13c8-4b16-8a95-9df6b6ad82d2"]},{"text":"I verify that HP checkbox is selected.","id":"c99aaf8b-2545-4dd1-ae82-754140f78584","astNodeIds":["13bf43fd-f0fa-480d-9fd5-15ee9b2ea35f"]}],"tags":[{"name":"@HomeTest","astNodeId":"64e26194-d67f-4fb9-9949-41913a27a3e6"},{"name":"@SmokeTest","astNodeId":"26a5a0e3-ad17-443e-8840-bdaec2f84609"}],"astNodeIds":["f167faaf-0709-491a-9ccc-07fa7e6d06fd"]}},{"source":{"uri":"file:///C:/Users/Shakir/Desktop/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Registration.feature","data":"Feature: Amazon Registration functionality check\r\n\r\n  Background:\r\n    Given I am on Amazon homepage\r\n    When I hover over \u0027Hello, Sign in\u0027 button\r\n    And I click on \u0027Start here\u0027 link on homepage\r\n\r\n  @Registration @SmokeTest\r\n  Scenario Outline: Check that user can navigate to the Registration page using title\r\n    Then I verify page \"\u003ctitle\u003e\"\r\n    Examples:\r\n      | title               |\r\n      | Amazon Registration |\r\n\r\n  @Registration @SmokeTest\r\n  Scenario: Check that if user does not provide a name when registering, an alert message\r\n  \"Enter your name\" will be displayed\r\n    And I enter a random email address in the \u0027Email\u0027 field\r\n    And I enter a random password in the \u0027Password\u0027 field\r\n    And I Re-enter the password in the `Re-enter password` field\r\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\r\n    Then I verify \u0027Enter your name\u0027 alert is displayed under `Your name` field\r\n\r\n  @Registration @SmokeTest\r\n  Scenario: Check that if user does not provide a email when registering, an alert message\r\n  \"Enter your email\" will be displayed\r\n    And I enter a random \u0027name\u0027\r\n    And I enter a random password in the \u0027Password\u0027 field\r\n    And I Re-enter the password in the `Re-enter password` field\r\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\r\n    Then I verify \u0027Enter your email\u0027 alert is displayed under `Email` field\r\n\r\n  @Registration @SmokeTest\r\n  Scenario Outline: Check that if user does not provide a valid email format when registering, an alert message\r\n  \"Enter your email\" will be displayed\r\n    And I enter a random \u0027name\u0027\r\n    And I enter an \"\u003cinvalid email\u003e\" address in the `Email` field\r\n    And I enter a random password in the \u0027Password\u0027 field\r\n    And I Re-enter the password in the `Re-enter password` field\r\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\r\n    Then I verify \"\u003calert\u003e\" is displayed under `Email` field\r\n    Examples:\r\n      | alert                       | invalid email  |\r\n      | Enter a valid email address | invalid@email. |\r\n\r\n  @Registration @SmokeTest\r\n  Scenario Outline: Check that if user does not provide a password when registering, an alert message\r\n  \"Enter your password\" will be displayed\r\n    And I enter a random \u0027name\u0027\r\n    And I enter a random email address in the \u0027Email\u0027 field\r\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\r\n    Then I verify \"\u003calert\u003e\" is displayed under `Password` field\r\n    Examples:\r\n      | alert               |\r\n      | Enter your password |\r\n\r\n  @Registration @SmokeTest\r\n  Scenario Outline: Check that if user does not re-enter a password when registering, an alert message\r\n  \"Type your password again\" will be displayed\r\n    And I enter a random \u0027name\u0027\r\n    And I enter a random email address in the \u0027Email\u0027 field\r\n    And I enter a random password in the \u0027Password\u0027 field\r\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\r\n    Then I verify \"\u003calert\u003e\" is displayed under `Re-Enter password` field\r\n    Examples:\r\n      | alert                    |\r\n      | Type your password again |\r\n\r\n  @Registration @SmokeTest\r\n  Scenario Outline: Check that if user does not provide a password that is at least 6 characters long\r\n  when registering, two alert messages \"Passwords must be at least 6 characters.\" and\r\n  \"Type your password again\" will be displayed\r\n    And I enter a random \u0027name\u0027\r\n    And I enter a random email address in the \u0027Email\u0027 field\r\n    And I enter a random five character long password in the \u0027Password\u0027 field\r\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\r\n    Then I verify \"\u003cPassword alert\u003e\" is displayed under `Password` field for not meeting the password criteria\r\n    And I verify \"\u003cRe-enter password alert\u003e e\" and submit in the search field.\r\n    Then I verify items with \"\u003cpageTitle\u003e\".\r\n    Examples:\r\n      | itemName                 | pageTitle                             |\r\n      | Matcha Green Tea         | Amazon.com : Matcha Green Tea         |\r\n      | Rage Against The Machine | Amazon.com : Rage Against The Machine |\r\n\r\n  @SearchTest @SmokeTest\r\n  Scenario Outline: Amazon \u0027All\u0027 dropdown search functionality check with \u0027Computers\u0027 department\r\n    When I select \"\u003cdepartment\u003e\" from \u0027All\u0027 dropdown\r\n    And I submit search field\r\n    Then I verify that I am in \u0027Computers\u0027 department with \"\u003cpageText\u003e\".\r\n    Examples:\r\n      | department | pageText                              |\r\n      | Computers  | Computers, Tablets and IT Accessories |\r\n\r\n  @SearchTest @SmokeTest @MyTest\r\n  Scenario Outline: Amazon \u0027All\u0027 dropdown search functionality check by selecting each department and validating\r\n    with page text\r\n    When I select \"\u003cdepartment\u003e\" from \u0027All\u0027 dropdown\r\n    And I submit search field\r\n    Then I verify that I am in \u0027Computers\u0027 department with \"\u003cpageText\u003e\".\r\n    Examples:\r\n      | department | pageText                              |\r\n      | Computers  | Computers, Tablets and IT Accessories |\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Shakir/Desktop/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Search.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Amazon search functionality check","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on Amazon homepage","id":"357354ff-3d90-4475-a1b4-6f0c7f671f3f"}],"id":"cdd3c8e9-15c9-47b0-be33-b56e50266cd0"}},{"scenario":{"loc r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that an alert message is displayed when user tries to login with an invalid email\r\n    And I enter an invalid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    Then I verify that the \"\u003calert message\u003e\" is displayed\r\n    Examples:\r\n      | email address                 | alert message                                     |\r\n      | invalidEmail@invalidEmail.com | We cannot find an account with that email address |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that an alert message is displayed when user tries to login with an invalid phone number\r\n    And I enter an invalid \"\u003cphone number\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    Then I verify that the \"\u003calert message\u003e\" is displayed\r\n    Examples:\r\n      | phone number | alert message                                     |\r\n      | 8399283899   | We cannot find an account with that mobile number |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that an alert message is displayed when user tries to login with an invalid password\r\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    And I enter an invalid \"\u003cpassword\u003e\" on the \u0027Password\u0027 field\r\n    And I click on \u0027Sign-in\u0027 button after password\r\n    Then I verify that the \"\u003calert message1\u003e\" or \"\u003calert message2\u003e\" is displayed\r\n    Examples:\r\n      | email address            | password        | alert message1             | alert message2                                                                                                                    |\r\n      | ciara105@xhanimatedm.com | InvalidPass123! | Your password is incorrect | To better protect your account, please re-enter your password and then enter the characters as they are shown in the image below. |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that an user can successfully log into Amazon\r\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    And I enter a valid \"\u003cpassword\u003e\" on the Password field\r\n    And I click on \u0027Sign-in\u0027 button after password\r\n    Then I verify that \"\u003cuser\u0027s name\u003e\" is displayed\r\n    Examples:\r\n      | email address               | password   | user\u0027s name |\r\n      | shakir.jahangir83@gmail.com | BugBusters | Shakir      |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that two users can successfully log into Amazon consecutively\r\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    And I enter a valid \"\u003cpassword\u003e\" on the Password field\r\n    And I click on \u0027Sign-in\u0027 button after password\r\n    Then I verify that \"\u003cuser\u0027s name\u003e\" is displayed\r\n    Examples:\r\n      | email address               | password   | user\u0027s name |\r\n      | shakir.jahangir83@gmail.com | BugBusters | Shakir      |\r\n      | zarria@xhanimatedm.com      | BugBusters | Phong       |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that an alert message is displayed when user tries to login without an email or phone number\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    Then I verify that the missing email or phone \"\u003calert message\u003e\" is displayed\r\n    Examples:\r\n      | alert message                           |\r\n      | Enter your email or mobile phone number |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that an alert message is displayed when user tries to login without a password\r\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Sign-in\u0027 button after password\r\n    Then I verify that the missing password \"\u003calert message\u003e\" is displayed\r\n    Examples:\r\n      | email address               | alert message       |\r\n      | shakir.jahangir83@gmail.com | Enter your password |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that user can navigate to \u0027Forgot your password?\u0027 page\r\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Forgot your password?\u0027 link\r\n    Then I verify \"\u003cpage title\u003e\"\r\n    Examples:\r\n      | email address               | page title                 |\r\n      | shakir.jahangir83@gmail.com | Amazon Password Assistance |\r\n\r\n  @SignInTest @SmokeTest\r\n  Scenario Outline: Check that alert message is displayed when user can navigate to \u0027Forgot your password?\u0027 page\r\n  and enter invalid email address\r\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\r\n    And I click on \u0027Forgot your password?\u0027 link\r\n    And I clear the \u0027Email or mobile phone number\u0027 field\r\n    And I enter an \"\u003cinvalid email address\u003e\" on Forgot your password? page\r\n    And I click on \u0027Continue\u0027 button on \u0027Forgot your password?\u0027 page\r\n    Then I verify by \"\u003ccaptcha\u003e\" or an \"\u003calert text\u003e\"\r\n    Examples:\r\n      | email address               | invalid email address    | captcha                                                  | alert text                                                                   |\r\n      | shakir.jahangir83@gmail.com | bogusemail9183@bogus.com | Please solve this puzzle so we know you\u0027re a real person | We\u0027re sorry. We weren\u0027t able to identify you given the information provided. |\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Shakir/Desktop/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/SignIn.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Amazon Sign In functionality check","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on Amazon homepage","id":"d687349c-7e76-49a2-b710-37083a224279"},{"location":{"line":5,"column":5},"keyword":"When ","text":"I hover over \u0027Hello, Sign in\u0027 button","id":"132ffcdd-ead6-4083-bdaa-7db39238ce22"},{"location":{"line":6,"column":5},"keyword":"And ","text":"I click on \u0027Sign in\u0027 button under Hello, Sign in","id":"20ace2e1-d36a-4098-ad60-41c1a05ed344"}],"id":"8eb7de3b-07e0-4bec-8f57-44b3ee5f5fc8"}},{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":8,"column":3},"name":"@SignInTest","id":"70a837e8-75a0-4099-aaf1-61b4350f86d1"},{"location":{"line":8,"column":15},"name":"@SmokeTest","id":"d16e9bf1-0400-4ccb-b084-b12ac48cb364"}],"keyword":"Scenario","name":"Check that user can navigate from homepage to Sign In page using title","steps":[{"location":{"line":10,
